import "./pages/App.css";
import { SideBar } from "./components/SideBar";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";

function App() {
  return (
    <Router>
      <SideBar />
      <Routes>
        <Route path="/Home" exact component={Home} />
      </Routes>
    </Router>
  );
}

export default App;
